fig_nlls, axs_nlls = plt.subplots(2, 3)
fig_nlls.suptitle('Non-linear least squares error')
for i in range(6):
    row = i // 3
    col = i % 3
    ax = axs_nlls[row, col]
    surf = surfaces[i]
    ax.set_title(f'{surf}')

    y_tr = nlls_err[f'{surf}-tr']
    y_bk = nlls_err[f'{surf}-bk']
    xs = nlls_xs[f'{surf}']
    min_x_idx_bk = np.argmin(y_bk)
    min_bk = xs[min_x_idx_bk]
    min_x_idx_tr = np.argmin(y_tr)
    min_tr = xs[min_x_idx_tr]
    print(f'{surf}')
    print('---- bk')
    for x, err in zip(xs[min_x_idx_bk - 2:min_x_idx_bk + 3], y_bk[min_x_idx_bk - 2:min_x_idx_bk + 3]):
        print(f'{x:.3f}, {err:.3f}')
    print('---- tr')
    for x, err in zip(xs[min_x_idx_tr - 2:min_x_idx_tr + 3], y_tr[min_x_idx_tr - 2:min_x_idx_tr + 3]):
        print(f'{x:.3f}, {err:.3f}')

    ax.plot(xs, y_tr, label=f'TR: {min_tr:.3}')
    ax.plot(xs, y_bk, label=f'Bk: {min_bk:.3}')
    ax.scatter(min_tr, np.min(y_tr), color='r', marker='x')
    ax.scatter(min_bk, np.min(y_bk), color='r', marker='x')
    ax.legend()
    ax.grid()

